import React from 'react'

const Navbar = () => {

    const links = [
        {
            id: 1,
            link: 'home'
        },
        {
            id: 2,
            link: 'movies/shows'
        },
        {
            id: 3,
            link: 'subscription'
        },
        {
            id: 4,
            link: 'profile'
        },
    ]
    return (
        <>
            <nav className='bg-cyan-500'>
                <ul className=' flex space-x-5 px-5  py-5  '> 
                    {links.map(({ id, link }) => {
                        return (<>
                            <li className=''>{link}</li>
                        </>)
                    })}
                </ul>
            </nav>
        </>
    );

}

export default Navbar
